---**`HUD` | `client`**<br>
--- [Native Documentation](https://docs.fivem.net/natives/?_0x6DD05E9D83EFA4C9)<br>
--- Creates a gamer tag for the specified local player ID, automatically attached to the player's current ped.
--- The created gamer tag will have the same ID as the player. You can use [IS_MP_GAMER_TAG_ACTIVE](#\_0x4E929E7A5796FD26)<br> to check if a gamer tag already exists for a player.
--- After the gamer tag is created, all components will be set as invisible. Use [SET_MP_GAMER_TAG_VISIBILITY](#\_0x63BB75ABEDC1F6A0)<br> to change the visibility of individual components or [\_SET_MP_GAMER_TAG_VISIBILITY_ALL](#\_0xEE76FF7E6A0166B0) to set all of them at once.
--- To create a gamer tag for a ped that is not a player, see [CREATE_FAKE_MP_GAMER_TAG](#\_0xBFEFE3321A3F5015)<br>.
---```lua
---local playerId = PlayerId() -- you can use any local player ID here
---
----- clear any already existing gamer tag associated with this player
---if IsMpGamerTagActive(playerId) then
---	RemoveMpGamerTag(playerId)
---
---	-- wait until the gamer tag actually becomes free
---	repeat Wait(0) until IsMpGamerTagFree(playerId)
---end
---
----- create the gamer tag
---CreateMpGamerTagWithCrewColor(playerId, "jaymoo", false, true, "RSG", 0, 200, 0, 200)
---
----- set the name, crew and typing indicator components as visible
---SetMpGamerTagVisibility(playerId, 0, true)
---SetMpGamerTagVisibility(playerId, 1, true)
---SetMpGamerTagVisibility(playerId, 16, true)
---```
---@param player integer
---@param crewIsPrivate boolean
---@param crewIsRockstar boolean
---@param crewRank integer
---@param crewR integer
---@param crewG integer
---@param crewB integer
---@return string username, string crewName
function CreateMpGamerTagWithCrewColor(player, crewIsPrivate, crewIsRockstar, crewRank, crewR, crewG, crewB) end

