--- Asynchronously starts a line-of-sight (raycast) world probe shape test.
--- ```cpp
--- enum eTraceFlags
--- {
--- None = 0,
--- IntersectWorld = 1,
--- IntersectVehicles = 2,
--- IntersectPeds = 4,
--- IntersectRagdolls = 8,
--- IntersectObjects = 16,
--- IntersectPickup = 32,
--- IntersectGlass = 64,
--- IntersectRiver = 128,
--- IntersectFoliage = 256,
--- IntersectEverything = 511
--- }
--- ```
--- ```cpp
--- enum eTraceOptionFlags
--- {
--- None = 0,
--- OptionIgnoreGlass = 1,
--- OptionIgnoreSeeThrough = 2,
--- OptionIgnoreNoCollision = 4,
--- OptionDefault = 7
--- }
--- ```
--- NOTE: Raycasts that intersect with mission_entites (flag = 2) has limited range and will not register for far away entites. The range seems to be about 30 metres.
--- Use the handle with [GET_SHAPE_TEST_RESULT](#\_0x3D87450E15D98694)<br> or [GET_SHAPE_TEST_RESULT_INCLUDING_MATERIAL](#\_0x65287525D951F6BE) until it returns 0 or 2.
